import React from 'react';
import PropType from "prop-types";

const Gasto = ({ gasto }) => (
    <li className="gastos">
        <p>
            {gasto.nombre}
            <span className="gasto"> {gasto.cantidad}</span>
        </p>
    </li >
);

Gasto.propTypes={
    gastos:PropTypes.object.isRequired
}

export default Gasto;
